import{_ as t,c as e,o,ah as r}from"./chunks/framework.PvdZnrZd.js";const d=JSON.parse('{"title":"LINNWORKS CONNECTOR","description":"LINNWORKS CONNECTOR","frontmatter":{"title":"LINNWORKS CONNECTOR","description":"LINNWORKS CONNECTOR","date":"2025-07-25T00:00:00.000Z","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/featured-app/connector/linnworks-connector.md","filePath":"zenith/featured-app/connector/linnworks-connector.md"}'),a={name:"zenith/featured-app/connector/linnworks-connector.md"};function l(i,n,s,p,c,g){return o(),e("div",null,[...n[0]||(n[0]=[r('<p>Connect <strong><a href="https://www.linnworks.com/" target="_blank" rel="noreferrer">Linnworks</a></strong>, an order management software, with <strong><a href="/zenith/introduction/overview.html">Multivendor Marketplace App</a></strong> for <strong>Shopify</strong> using this connector add-on.</p><p><strong>What is Linnworks?</strong><br> Linnworks is an eCommerce platform that helps online retailers automate key processes, reduce costs, and grow their business.</p><p>An order management system using which you can spend less time on order processing, labels, picking, packing and spreadsheets, and more time leading your business.</p><p>**Pricing of the connector:<br> **This feature will have an additional charge of <strong>USD 25 per month</strong> over &amp; above your current Multivendor Marketplace plan.</p><h2 id="purpose-of-this-connector" tabindex="-1">Purpose of this connector: <a class="header-anchor" href="#purpose-of-this-connector" aria-label="Permalink to &quot;Purpose of this connector:&quot;">​</a></h2><p>Here are all the things that you can allow your sellers to sync once they connect their Linnworks store with the Marketplace:</p><p>The sellers can sync and auto-update the product <strong>name</strong>, <strong>inventory</strong>, <strong>price</strong>, <strong>image</strong>, <strong>description</strong>. Also, all the details regarding the orders can also be synced.</p><p>Any changes done on the seller&#39;s Linnworks store can be auto-updated on the Marketplace app. The seller can also set up price rules according to his needs.</p><p>Admin can also decide how he wants to charge tax on the products.</p><h2 id="admin-panel-installation-configuration" tabindex="-1">Admin Panel: Installation &amp; Configuration <a class="header-anchor" href="#admin-panel-installation-configuration" aria-label="Permalink to &quot;Admin Panel: Installation &amp; Configuration&quot;">​</a></h2><p>Visit <strong>Multivendor Admin Panel</strong> &gt; <strong>Feature Apps</strong> &gt; <strong>Enable</strong> the add-on:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/08/Feature-Apps-Admin-1200x597.png" alt="Feature-Apps-Admin"></p><p>Once enabled, you need to configure it.</p><p>Visit <strong>Multivendor Admin Panel</strong> &gt; <strong>Configuration</strong> &gt; <strong>Linnworks</strong> <strong>Configuration</strong> &gt; Enter the required details- <strong>Application ID</strong>, <strong>Application Secret</strong>, <strong>Installation URL</strong> &amp; <strong>Channel Name</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/10/Linnworks-App-Configuration-Admin-1200x940.png" alt="Linnworks-App-Configuration-Admin"></p><p>At the end of this page, you will have the Manifest that you can download. You will need them at the time you&#39;ll create an app on Linnworks.</p><h2 id="how-to-get-application-id-secret-installation-url" tabindex="-1">How to get Application ID, Secret &amp; Installation URL? <a class="header-anchor" href="#how-to-get-application-id-secret-installation-url" aria-label="Permalink to &quot;How to get Application ID, Secret &amp; Installation URL?&quot;">​</a></h2><p>Visit <a href="https://developer.linnworks.com/" target="_blank" rel="noreferrer"></a><a href="https://developer.linnworks.com/" target="_blank" rel="noreferrer">developer.linnworks.com/</a> and login:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/08/Sign-In-Linnworks-Developer-Portal-1200x592.png" alt="Sign-In-Linnworks-Developer-Portal"></p><p>Click on <strong>New App</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/08/Applications-www-linnworks-net-1200x597.png" alt="Applications-www-linnworks-net"></p><p>Now, enter the name of the application (it could be anything) and select <strong>Channel Integration</strong> as application type:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/08/Applications-www-linnworks-net-1-1200x597.png" alt="Applications-www-linnworks-net-1"></p><p>On the redirected page, click on <strong>App Modules</strong> &gt; <strong>Switch to text editor</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/08/Edit-Application-www-linnworks-net-1200x597.png" alt="Edit-Application-www-linnworks-net"></p><p>Copy-paste the Manifest that you have downloaded from the Linnworks Configuration page of the Multivendor Marketplace App &amp; save:</p><p><strong>NOTE</strong>: You need to fill these empty fields in the manifest before saving it.</p><p>These fields will be found twice; once under channel integration &amp; then under external application:</p><p>&quot;moduleName&quot;: &quot;&quot;,<br> &quot;formattedName&quot;: &quot;&quot;,</p><p>Also, these fields which will be found only once in the manifest:</p><p>{<br> &quot;name&quot;: &quot;ChannelName&quot;,<br> &quot;value&quot;: &quot;&quot;<br> },<br> {<br> &quot;name&quot;: &quot;ChannelFriendlyName&quot;,<br> &quot;value&quot;: &quot;&quot;<br> },</p><p>Maximum length is 20 characters.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/08/Edit-Application-www-linnworks-net-1-1200x597.png" alt="Edit-Application-www-linnworks-net-1"></p><p>Under the General tab, you will have the Application ID, Secret &amp; Installation URL:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/08/Edit-Application-www-linnworks-net-2-1200x597.png" alt="Edit-Application-www-linnworks-net-2"></p><p>Furthermore, add these to the Linnworks Configuration page of the Marketplace App.</p><h2 id="connector-configuartion" tabindex="-1">Connector Configuartion <a class="header-anchor" href="#connector-configuartion" aria-label="Permalink to &quot;Connector Configuartion&quot;">​</a></h2><p>Visit <strong>Multivendor Admin Panel</strong> &gt; <strong>Configuration</strong> &gt; <strong>Connector Configuration</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/08/Connector-Configurations-Admin-2-1200x848.png" alt="Connector-Configurations-Admin-2"></p><p>Choose whether you want to auto-update the following product details on Marketplace when the seller updates them on Linnworks:</p><ul><li>Name</li><li>Inventory</li><li>Price</li><li>Image</li><li>Description</li></ul><p>Next, choose how you want to charge tax on products:</p><ul><li>Charge tax as setup on the seller&#39;s Linnwork store</li><li>Not to charge tax on products</li><li>Or, charge tax on products as per you are charging on your marketplace products</li></ul><p><strong>Sync Order</strong>: From this option, you can choose whether you want to sync order with the seller&#39;s store. Further, choose to sync the following details with the seller&#39;s store:</p><ul><li>Shipping Address</li><li>Billing Address</li><li>Customer Name</li><li>Email ID</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/08/Connector-Configurations-Admin-3-1200x898.png" alt="Connector-Configurations-Admin-3"></p><h2 id="seller-panel-configuration" tabindex="-1">Seller Panel: Configuration <a class="header-anchor" href="#seller-panel-configuration" aria-label="Permalink to &quot;Seller Panel: Configuration&quot;">​</a></h2><p>The sellers need to visit <strong>Multivendor Seller Panel</strong> &gt; <strong>Configuration</strong> &gt; <strong>Linnworks Configuration</strong>:</p><p>Further, they need to download <strong>Shopify Linnworks App</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/12/Linnworks-Details-Seller-%E2%80%A2-Multivendor-MarketPlace-1200x597-1.png" alt="Linnworks-Details-Seller-•-Multivendor-MarketPlace-1200x597-1"></p><p>The seller will land on a page where they will need to login to their Linnworks account:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/08/Linnworks-net-Authorize-Application-1200x597.png" alt="Linnworks-net-Authorize-Application"></p><p>After login, install the app:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/08/Linnworks-net-Authorize-Application-1-1200x597.png" alt="Linnworks-net-Authorize-Application-1"></p><p>Once installed, you will have this success message:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/08/Linnworks-net-Authorize-Application-2-1200x597.png" alt="Linnworks-net-Authorize-Application-2"></p><h2 id="channel-integration" tabindex="-1">Channel Integration <a class="header-anchor" href="#channel-integration" aria-label="Permalink to &quot;Channel Integration&quot;">​</a></h2><p>Visit <a href="https://www.linnworks.net/" target="_blank" rel="noreferrer">linnworks.net</a> &amp; go to <strong>Settings</strong> &gt; <strong>Channel Integartion</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/10/Homepage-www-linnworks-net-1200x597.png" alt="Homepage-www-linnworks-net"></p><p>Click on <strong>Add New</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/10/Channel-Integration-www-linnworks-net-1200x597.png" alt="Channel-Integration-www-linnworks-net"></p><p>Search for the channel &amp; install:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/10/Channel-Integration-www-linnworks-net-1-1200x597.png" alt="Channel-Integration-www-linnworks-net-1"></p><p>Enter an account name for your own reference. This should be a unique name to help you to identify the integration within the system.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/10/Channel-Integration-www-linnworks-net-3-1200x597.png" alt="Channel-Integration-www-linnworks-net-3"></p><p>Agree to the terms &amp; conditions and proceed:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/10/Channel-Integration-www-linnworks-net-4-1200x597.png" alt="Channel-Integration-www-linnworks-net-4"></p><p>Add the account name. This should be unique.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2022/04/fdd9f25d0bc61254d21df23e9a8041c0-1200x603.png" alt="fdd9f25d0bc61254d21df23e9a8041c0"></p><p>Finish:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/10/Channel-Integration-www-linnworks-net-6-1200x597.png" alt="Channel-Integration-www-linnworks-net-6"></p><p>Now, enable the integration:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/10/Channel-Integration-www-linnworks-net-7-1200x597.png" alt="Channel-Integration-www-linnworks-net-7"></p><p>You can edit <strong>channel location mapping</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/10/Channel-Integration-www-linnworks-net-8-1200x597.png" alt="Channel-Integration-www-linnworks-net-8"></p><p>Product mapping can also be done:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/10/Channel-Mapping-www-linnworks-net-1200x597.png" alt="Channel-Mapping-www-linnworks-net"></p><p>Now, visit <strong>Multivendor Seller Panel</strong> &gt; <strong>Configuration</strong> &gt; <strong>Linnworks Configuration</strong> (refresh the page manually):</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/12/Linnworks-Details-Seller-%E2%80%A2-Multivendor-MarketPlace-1200x859.png" alt="Linnworks-Details-Seller-•-Multivendor-MarketPlace"></p><p>Select the weight unit of linnworks store and the currency. Also, save the changes.</p><p>Click on <strong>Import Products</strong> to import products from Linnworks. Here, you can import products from Linnworks via product SKUs or a CSV file.</p><p>Enter comma-separated SKUs or CSVs to import them:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/12/Import-Product-From-Linnworks-Seller-%E2%80%A2-Multivendor-MarketPlace-1200x893.png" alt="Import-Product-From-Linnworks-Seller-•-Multivendor-MarketPlace"></p><p>Lastly, the imported products will be listing under product listing section. They can be manually synced with the store if needed:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/08/Product-Seller-%E2%80%A2-Multivendor-MarketPlace-1200x597.png" alt="Product-Seller-•-Multivendor-MarketPlace"></p><h2 id="connector-price-rules" tabindex="-1">Connector Price Rules <a class="header-anchor" href="#connector-price-rules" aria-label="Permalink to &quot;Connector Price Rules&quot;">​</a></h2><p>Visit <strong>Multivendor Seller Panel</strong> &gt; <strong>Configuration</strong> &gt; <strong>Connector Price Rule</strong> &gt; Set up <strong>Price Rule</strong>:</p><p>**What is a Price Rule?<br> **This is the amount of the price difference between Shopify Marketplace products with respect to Linnworks store products.</p><p><strong>Example</strong>: If you set the Price Rule= 10% (decrease) then a product of $100 at Linnworks will be listed for $90 at Shopify Marketplace.</p><p>Similarly, a product of $100 at Shopify Marketplace will be listed for $110 at Linnworks.</p><p>So, you need to select the price rule to be incremented or decremented. Price change could be in percentage or a fixed amount &amp; lastly, add the value.</p><p>If you are setting this up after syncing products then click on the checkbox so that the price of previously added products is changed automatically as per the rule set.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/08/Price-Rule-Seller-%E2%80%A2-Multivendor-MarketPlace-1130x1024.png" alt="Price-Rule-Seller-•-Multivendor-MarketPlace"></p>',93)])])}const h=t(a,[["render",l]]);export{d as __pageData,h as default};
